"use strict";

sap.ui.define("com/uniorg/cf/banking/example/controller/App.controller", ["sap/ui/model/json/JSONModel", "com/uniorg/cf/banking/example/controller/BaseController"], function (JSONModel, BaseController) {
	"use strict";

	return BaseController.extend("com.uniorg.cf.banking.example.controller.App", {
		onInit: function onInit() {
			var oJSONModel = new JSONModel();

			sap.ui.getCore().setModel(oJSONModel, "accountModel");

			this.getView().setModel(sap.ui.getCore().getModel("accountModel"));
		},
		onPressSideNavigationToggleButton: function onPressSideNavigationToggleButton(event) {
			console.log(this.getView().getModel().getData());
			//var oSideNavigation = this.getView().byId('sideNavigation');
			//oSideNavigation.setExpanded(!oSideNavigation.getExpanded());
			var toolPage = this.getView().byId("toolPage");
			toolPage.setSideExpanded(!toolPage.getSideExpanded());
		},
		onItemSelect: function onItemSelect(oEvent) {
			var item = oEvent.getParameter("item");

			switch (item.getKey()) {
				case "accounts":
					this.getRouter().navTo("accounts");
					break;
				case "banks":
					this.getRouter().navTo("banks");
					break;
				case "accountSales":
					this.getRouter().navTo("accountSales");
					break;
				case "accountSalesChart":
					this.getRouter().navTo("accountSalesChart");
					break;
			}
		}
	});
});
